import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Navbar from '../Components/nav-admin';

function UserTable() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = () => {
        axios.get('http://localhost:3002/Doctors/view')
            .then(response => {
                setUsers(response.data);
            })
            .catch(error => {
                console.error('Failed to fetch users:', error);
            });
    };
    const verifyUser = (id) => {
        if (!id) {
            alert('User ID is missing.');
            return;
        }

        fetch(`http://localhost:3002/doctor/verify/${id}`, {
            method: 'PATCH',
            headers: {
                'Content-Type': 'application/json',
            }
        })
        .then(response => response.json())
        .then(data => {
            alert('User verified successfully');
            fetchUsers();  // Refresh list to show updated status
        })
        .catch(error => {
            console.error('Error verifying user:', error);
            alert('Failed to verify the user.');
        });
    };

    const deleteUser = (id) => {
        if (!id) {
            alert('User ID is missing.');
            return;
        }

        if (window.confirm(`Are you sure you want to delete this user?`)) {
            axios.delete(`http://localhost:3002/Doctors/delete/${id}`)
                .then(response => {
                    alert(response.data.message || "User deleted successfully");
                    fetchUsers(); 
                })
                .catch(error => {
                    console.error('Error:', error);
                    alert('Failed to delete the user.');
                });
        }
    };

    return (
        <div className="user-management-container">
            <Navbar />
            <div className="user-table-container">
                <table className="user-table">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Role</th>
                            <th>Registered ID</th>
                            <th>Working Hospitals</th>
                            <th>Age</th>
                            <th>Contact No</th>
                            {/* <th>Available Time</th> */}
                            <th>Bio</th>
                            <th>Profile Image</th>
                            <th>Signature Image</th>
                            <th>Actions</th>

                        </tr>
                    </thead>
                    <tbody>
                        {users.map(user => (
                            <tr key={user._id}>
                                <td>{user.userName}</td>
                                <td>{user.email}</td>
                                <td>{user.role}</td>
                                <td>{user.registeredId}</td>
                                <td>{user.workingHospitals}</td>
                                <td>{user.age}</td>
                                <td>{user.contactNo}</td>
                                {/* <td>{user.availableTime}</td> */}
                                <td>{user.bio}</td>
                                <td>
                                    <img src={user.profileImage} alt="Profile" style={{ width: "50px", height: "50px" }} />
                                </td>
                                <td>
                                    <img src={user.signatureImage} alt="Profile" style={{ width: "50px", height: "50px" }} />
                                </td>
                                <td>
                                    <button onClick={() => alert('Edit functionality not implemented')}>Edit</button>
                                    <button onClick={() => deleteUser(user._id)}>Delete</button>
                                </td>
                                <td>
                                    {user.isVerified ? (
                                        'Verified'
                                    ) : (
                                        <button onClick={() => verifyUser(user._id)}>Verify</button>
                                    )}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default UserTable;
